import React from "react";
import styled from "styled-components";
import Section from "../components/Section";
import PropTypes from "prop-types";
import Header from "../components/Header";
import Footer from "../components/Footer";
import Log from "../components/Log";

function Login() {
  return (
    <div>
      <Container>
        <Header />
        <Section>
          <Log />
        </Section>
        <Footer />
      </Container>
    </div>
  );
}

export default Login;

const Container = styled.div`
  height: 100vh;
  label {
    width: 300px;
    color: purple;
    height: 20px;
    display: flex;
    justify-content: center;
    align-items: center;
    text-transform: uppercase;
    font-size: 15px;
    text-align: center;
  }

  input {
    width: 300px;
    color: white;
    background-color: rgba(23, 26, 32, 0.8);
    height: 40px;
    display: flex;
    justify-content: center;
    align-items: center;
    border-radius: 60px;
    opacity: 0.85;
    font-size: 12px;
    cursor: hover;
    text-align: center;
  }

  select {
    width: 300px;
    color: white;
    background-color: rgba(23, 26, 32, 0.8);
    height: 40px;
    display: flex;
    justify-content: center;
    align-items: center;
    border-radius: 60px;
    opacity: 0.85;
    font-size: 15px;
    cursor: pointer;
    text-align: center;
  }
`;
